import {BrowserRouter, Route, Router} from 'react-dom'
import SideMenu from '../SideMenu/dashboard';

function AppRoutes(){
    return(
        <BrowserRouter>
            <Router>
                <Route path='/dasboard' element={<SideMenu />} />
            </Router>
        </BrowserRouter>
        
        
       
    )

}
export default AppRoutes;
